import React from 'react';

import PopupWithForm from '../PopupWithForm/PopupWithForm';

function ConfirmPopup(isOpen, onClose, onSubmit, cardForDelete) {
  return (
    <PopupWithForm
      name="delete-confirmation"
      title={'Вы уверены?'}
      buttonName={'Да'}
      isOpen={isOpen}
      onClose={onClose}
      onSubmit={() => onSubmit(cardForDelete)}
    >
    </PopupWithForm>
  )
}

export default ConfirmPopup;
